import React from "react";
import TypeIt from "typeit-react";

export default () => {
  return (
    <div className="Home">
      <TypeIt
        getBeforeInit={(instance) => {
          instance
            .type("Hi, I'm Alxe")
            .pause(750)
            .delete(2)
            .pause(500)
            .type("ex!");

          // Remember to return it!
          return instance;
        }}
      />
      ;
    </div>
  );
};
